INSERT INTO `article` (`id`, `slug`, `title`, `body`, `category_id`, `thumbnail_base_url`, `thumbnail_path`, `status`, `created_by`, `updated_by`, `published_at`, `created_at`, `updated_at`, `only_link`, `link`) VALUES
	(2, 'obama-book-deals-getting-close', 'Obama Book Deals Getting Close', '<p>Book proposals from former President Barack Obama and former First Lady Michelle Obama are making the rounds among the Big Five trade publishers in New York, while a book by one of the Obama administration\'s highest profile cabinet members has already been acquired.</p><p>According to several sources, a book by former Secretary of State John Kerry has been signed, although the winner of the auction has not yet been disclosed. A deal for Michelle Obama\'s book is said to be close, while an agreement for the former President\'s book is expected to be completed following the closing of the deal for his wife\'s book.</p>', 2, '/storage/web/source', '1/ijCc40iJrURni6-ZxR6-iGq3DsQ7D5ac.jpg', 1, 4, 4, 1488481990, 1488481990, 1488482299, 0, '0'),
	(3, 'amazon-unveils-first-east-coast-bricks-and-mortar', 'Amazon Unveils First East Coast Bricks and Mortar', '<p>Amazon opened the doors to its first East Coast bricks and mortar bookstore on Tuesday. The 5,800 sq. ft. store, in Dedham, Mass., which is the first of the e-tailer\'s physical stores featuring a cafe, is located at Legacy Place, a large commercial retail center ten miles from downtown Boston. The opening is part of Amazon’s nationwide push to open six physical bookstores by the spring. Once all six bricks and mortar locations are open, Amazon will have a total of nine stores across the country.</p><p>Amazon opened its <a href="http://www.publishersweekly.com/pw/by-topic/industry-news/bookselling/article/68573-inside-amazon-s-first-physical-bookstore.html">first physical bookstore</a> in 2015. Situated in the company\'s home state of Washington near the University of Washington campus, the store encouraged something most bricks and mortar booksellers despise: showrooming. (Showrooming is the consumer practice of browsing products in a physical store with the intention of buying them later, online, likely at a cheaper price.)</p>', 1, '/storage/web/source', '1/z4VS8orPq80G6KN-0LDc54NThSxdkIn_.jpg', 1, 4, 4, 1488482045, 1488482045, 1488482293, 0, '0'),
	(4, 'book-deals-week-of-february-13-2017', 'Book Deals: Week of February 13, 2017', '<p>Kensington Publishing’s <strong>John Scognamiglio</strong> took world rights to <em>Mrs. Jacob Klein’s Story</em>, a historical debut novel by <strong>V.A. Shannon</strong>, in a deal brokered by <strong>Eric Myers</strong> of Dystel, Goderich, and Bourret. According to Myers, the novel is set in the days of American pioneering, telling “the tale of a survivor of the ill-fated Donner Party as she looks back on her ordeal in the Sierras... 10 years later.” The book is slated to be published in fall 2018.</p>', 2, '/storage/web/source', '1/FET3g44Q2hDp_lt8hqQIwMSLeG6wZQGc.jpg', 1, 4, 4, 1488482203, 1488482203, 1488482287, 0, '0'),
	(5, 'pen-america-announces-2017-literary-award-winners', 'PEN America Announces 2017 Literary Award Winners', '<p>This interview was conducted in July 1966, in conversations I held with Borges at his office in the Biblioteca Nacional, of which he is the director. The room, recalling an older Buenos Aires, is not really an office at all but a large, ornate, high-ceilinged chamber in the newly renovated library. On the walls—but far too high to be easily read, as if hung with diffidence—are various academic certificates and literary citations. There are also several Piranesi etchings, bringing to mind the nightmarish Piranesi ruin in Borges’s story, “The Immortal.” Over the fireplace is a large portrait; when I asked Borges’s secretary, Miss Susana Quinteros, about the portrait, she responded in a fitting, if unintentional echo of a basic Borgesean theme: “No importa. It’s a reproduction of another painting.”</p><p>   At diagonally opposite corners of the room are two large, revolving bookcases that contain, Miss Quinteros explained, books Borges frequently consults, all arranged in a certain order and never varied so that Borges, who is nearly blind, can find them by position and size. The dictionaries, for instance, are set together, among them an old, sturdily rebacked, well-worn copy of <em>Webster’s Encyclopedic Dictionary of the English Language</em> and an equally well-worn Anglo-Saxon dictionary. Among the other volumes, ranging from books in German and English on theology and philosophy to literature and history, are the complete <em>Pelican Guide to English Literature, </em>the Modern Library’s <em>Selected Writings </em>of Francis Bacon<em>,</em> Hollander’s <em>The Poetic Edda, The Poems of Catullus,</em> Forsyth’s <em>Geometry of Four Dimensions,</em> several volumes of Harrap’s<em> </em>English Classics<em>,</em> Parkman’s <em>The Conspiracy of Pontiac,</em> and the<em> </em>Chambers edition of <em>Beowulf</em>. Recently, Miss Quinteros said, Borges had been reading <em>The American Heritage</em> <em>Picture History of the Civil War,</em> and just the night before he had taken to his home, where his mother, who is in her nineties, reads aloud to him, Washington Irving’s <em>The Life of Mahomet.</em></p><p>Each day, late in the afternoon, Borges arrives at the library where it is now his custom to dictate letters and poems, which Miss Quinteros types and reads back to him. Following his revisions, she makes two or three, sometimes four copies of each poem before Borges is satisfied. Some afternoons she reads to him, and he carefully corrects her English pronunciation. Occasionally, when he wants to think, Borges leaves his office and slowly circles the library’s rotunda, high above the readers at the tables below. But he is not always serious, Miss Quinteros stressed, confirming what one might expect from his writing: “Always there are jokes, little practical jokes.”</p><p>When Borges enters the library, wearing a beret and a dark gray flannel suit hanging loosely from his shoulders and sagging over his shoes, everyone stops talking for a moment, pausing perhaps out of respect, perhaps out of empathetic hesitation for a man who is not entirely blind. His walk is tentative, and he carries a cane, which he uses like a divining rod. He is short, with hair that looks slightly unreal in the way it rises from his head. His features are vague, softened by age, partially erased by the paleness of his skin. His voice, too, is unemphatic, almost a drone, seeming, possibly because of the unfocused expression of his eyes, to come from another person behind the face; his gestures and expressions are lethargic—characteristic is the involuntary droop of one eyelid. But when he laughs—and he laughs often—his features wrinkle into what actually resembles a wry question mark; and he is apt to make a sweeping or clearing gesture with his arm and to bring his hand down on the table. Most of his statements take the form of rhetorical questions, but in asking a genuine question, Borges displays now a looming curiosity, now a shy, almost pathetic incredulity. When he chooses, as in telling a joke, he adopts a crisp, dramatic tone; his quotation of a line from Oscar Wilde would do justice to an Edwardian actor. His accent defies easy classification: a cosmopolitan diction emerging from a Spanish background, educated by correct English speech and influenced by American movies. (Certainly no Englishman ever pronounced <em>piano</em> as “pieano,” and no American says “a-nee-hilates” for <em>annihilates</em>.) The predominant quality of his articulation is the way his words slur softly into one another, allowing suffixes to dwindle so that “couldn’t” and “could” are virtually indistinguishable. Slangy and informal when he wants to be, more typically he is formal and bookish in his English speech, relying, quite naturally, on phrases like “that is to say” and “wherein.” Always his sentences are linked by the narrative “and then” or the logical “consequently.”</p><p>But most of all, Borges is shy. Retiring, even self-obliterating, he avoids personal statement as much as possible and obliquely answers questions about himself by talking of other writers, using their words and even their books as emblems of his own thought.</p><p>In this interview it has been attempted to preserve the colloquial quality of his English speech—an illuminating contrast to his writings and a revelation of his intimacy with a language that has figured so importantly in the development of his writing.</p>', 3, '/storage/web/source', '1/q12j80WPOS0PvCydS71-Yo-OjpKmV5ma.jpg', 1, 4, 4, 1488482261, 1488482261, 1488560565, 0, '0');
